import PropTypes from 'prop-types';

const Profile = (props) =>{
  return (
    <div class= "row">
      <div class="col-2">
       
      </div>
      <div class="col-6">
          <b>Full Name:</b><span>{props.fullName}</span>
          <b>Bio:</b><span>{props.bio}</span>
          <b>Profession:</b><span>{props.profession}</span>
      </div>  
    </div>


  ) 
}
Profile.defaultProps={
 fullName : "full name",
 bio : "bio",
 profession : "profession"
}

Profile.propTypes={ 
    fullName: PropTypes.string.isRequired,   
    bio: PropTypes.string.isRequired,
    profession: PropTypes.string.isRequired
}
